import React,{Component} from 'react';



class Lista extends Component{
    constructor(props){
        super(props);
        this.state = {
            id:"",
            entrada:"",
            items:[]

        }


    }

    onKeyPress = evento => {


        this.setState({entrada: evento.target.value})

        //this.setState({entrada:event.target.value})
        alert("Você Digitou: " + this.state.entrada);


    }

    render(){

        return (
        <div>
            <form>
                <div className="form-group">
                    <label for="lentrada">Entrada: </label>
                    <input 
                        name="lentrada"
                        type="text"
                        value={this.state.entrada}
                        className="form-control"
                        onKeyPress={this.onKeyPress}
                        />                
                </div>
            </form>
        </div>
        )
    }
}

export default Lista;
